import React, { useState }from 'react';
import axios from 'axios';
import './App.css';
import Main from './components/Main';
import Navbar from './components/Navbar';
import Footer from './components/Footer';

function App() {
  const [formData, setFormData] = useState({
    Ndehistoriaclinica: '',
    nombre: '',
    apellido: '',
    genero: '',
    Fechadenacimiento: '',
    Enfermedad: '',
    otrasenfermedades: '',
    tratamiento: '',
    genotipos: '',
  });

  const [resultadosData, setResultadosData] = useState({
    Genotype: '',
    Phenotype: '',
    Population: '',
    Implications: '',
    Recommendation: '',
    OtherConsiderations: '',
    Classification: '',
  });

  const [resultados, setResultados] = useState([]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (geneId) => {

      axios
        .get(`/data/gene/${geneId}`, {
          headers: {
            'Api-Key': 'TU_CLAVE_DE_API',
          },
        })

        .then((response) => {
          // Procesa la respuesta de la API de PharmGKB
          const geneInfo = response.data;

          // Actualiza el estado con los datos relevantes
          setResultadosData({
            Genotype: geneInfo.genotype,
            Phenotype: geneInfo.phenotype,
            Population: geneInfo.population,
            Implications: geneInfo.implications,
            Recommendation: geneInfo.recommendation,
            OtherConsiderations: geneInfo.otherConsiderations,
            Classification: geneInfo.classification,
            });
        })
        .catch((error) => {
          console.error('Error al consultar la API de PharmGKB:', error);
          // Maneja errores aquí
        });
  };


  const handleDownloadPDF = () => {
    // Lógica para generar y descargar un PDF.
    // ...
  };


  return (
    <div className="App">
      <Navbar />
      <div className="Todo">
      <div className="main-content">
        <div className="row">
          <div className="column">
            <Main formData={formData} handleInputChange={handleInputChange} />
          </div>
          <div className="column column-center">
            <div className="buttons-container">
              <button id="descargarBtn" onClick={() => handleFetchData('geneId')}>Mostrar Resultados</button>
              <button type="submit" onClick={handleDownloadPDF}>Descargar PDF</button>
            </div>
          </div>
          <div className="column resultado-column">
            <div className="resultado-container">
                <h2>RESULTADO</h2>

                <div className="result-details">
                  <p className="result-section">
                    <strong>Genotipo:</strong> {resultadosData.Genotype}
                  </p>
                  <p className="result-section">
                    <strong>Fenotipo:</strong> {resultadosData.Phenotype}
                  </p>
                  <p className="result-section">
                    <strong>Populación:</strong> {resultadosData.Population}
                  </p>
                  <p className="result-section">
                    <strong>Implicaciones:</strong> {resultadosData.Implications}
                  </p>
                  <p className="result-section">
                    <strong>Recomendación:</strong> {resultadosData.Recommendation}
                  </p>
                  <p className="result-section">
                    <strong>Otras Consideraciones:</strong> {resultadosData.OtherConsiderations}
                  </p>
                  <p className="result-section">
                    <strong>Clasificación:</strong> {resultadosData.Classification}
                  </p>
                </div>
            </div>
          </div>
        </div>
      </div>
      </div>
      <Footer />
    </div>
  );
}


export default App;
